import React from 'react';
import {Card, Header}  from "./Component/Card";
import Showdata from "./Component/Sdata"
import './App.css';

function App() {

  function netCard(val) {
    return (
      <Card
       imgsrc={val.imgsrc}
       title={val.title}
       showname={val.showname}
       links={val.links}
       />
    )
  }

  return (
    <div>

     <Header />
     {Showdata.map(netCard)}

    </div>
  );
}

export default App;




